{
  "swagger": {
  "openapi": "3.0.1",
  "info": {
    "title": "STATS V1",
    "version": "1.0.0",
    "description": "Ma Ville Mon Shopping Catalog API"
  },
  "paths": {
    "/api/v1/stats/shops/{id}": {
      "parameters": [
        {
          "name": "id",
          "in": "path",
          "description": "Unique identifier of the desired shop.",
          "required": true,
          "schema": {
            "type": "string"
          }
        }
      ],
      "get": {
        "summary": "shop informations",
        "tags": [
          "Shops"
        ],
        "security": [
          {
            "authorization": [

            ]
          }
        ],
        "responses": {
          "200": {
            "description": "Successful",
            "content": {
              "application/json": {
                "schema": {
                  "type": "object",
                  "$ref": "#/components/schemas/ShopStats"
                }
              }
            }
          },
          "304": {
            "description": "Not Modified"
          },
          "404": {
            "description": "Not found",
            "content": {
              "application/json": {
                "schema": {
                  "type": "object",
                  "properties": {
                    "detail": {
                      "type": "string",
                      "example": "Resource not found",
                      "description": "Message of an error."
                    },
                    "message": {
                      "type": "string",
                      "example": "Not found",
                      "description": "Display description error."
                    },
                    "status": {
                      "type": "integer",
                      "example": 404,
                      "description": "Status of an error."
                    }
                  }
                }
              }
            }
          }
        }
      }
    }
  },
  "servers": [
    {
      "url": "https://stingy-advice-gw.aws-euc1.cloud-ara.tyk.io/statistics-dev"
    }
  ],
  "components": {
    "securitySchemes": {
      "authorization": {
        "type": "apiKey",
        "name": "authorization",
        "in": "header"
      }
    },
    "schemas": {
      "ShopStats": {
        "type": "object",
        "properties": {
          "id": {
            "type": "integer",
            "example": 42,
            "description": "Unique identifier of the shop."
          },
          "averageRating": {
            "type": "number",
            "description": "Average shop rating.",
            "example": 4.3
          },
          "ratingCount": {
            "type": "integer",
            "description": "Total rating of a shop.",
            "example": 15
          },
          "averagePrice": {
            "type": "number",
            "description": "Total search hit number.",
            "example": 23.4
          },
          "onlineProductsCount": {
            "type": "integer",
            "description": "Number of produts online in the shop.",
            "example": 27
          }
        }
      }
    }
  }
},
  "insert_into_api": true, 
  "api_id": "0101e2b639194ff57f6404d4214086fe"
}
